import React, { useEffect, useRef, useState } from 'react';
import Webcam from 'react-webcam';
import { useFaceDetection } from 'react-use-face-detection';
import FaceDetection from '@mediapipe/face_detection';

const FaceDetector = ({ onFacePositionChange, isEnabled = true }) => {
  const webcamRef = useRef(null);
  const [error, setError] = useState(null);
  
  // Initialize face detection with MediaPipe
  const { boundingBox, webcamRef: faceDetectionWebcamRef, isLoading, detected, facesDetected } = useFaceDetection({
    faceDetectionOptions: {
      model: 'short',
    },
    faceDetection: new FaceDetection.FaceDetection({
      locateFile: (file) => `https://cdn.jsdelivr.net/npm/@mediapipe/face_detection/${file}`,
    }),
  });

  // Set webcam reference from face detection hook to our ref
  useEffect(() => {
    try {
      webcamRef.current = faceDetectionWebcamRef.current;
    } catch (err) {
      console.error('Error setting webcam ref:', err);
      setError('Failed to initialize webcam');
    }
  }, [faceDetectionWebcamRef]);

  // Process bounding box data to determine face position
  useEffect(() => {
    try {
      if (!isEnabled || !detected || !boundingBox || boundingBox.length === 0) return;

      // We'll use the first detected face
      const face = boundingBox[0];
      
      // Use the face position data based on the format from the example
      // The example shows xCenter, yCenter, width, height as the properties
      const relativeX = face.xCenter; 
      const relativeY = face.yCenter;
      
      // Determine which direction to move based on face position
      // We divide the screen into sections for simplicity
      let direction = null;
      
      // Horizontal position (left/right)
      if (relativeX < 0.4) {
        direction = 'l'; // Move left when face is on the right side
      } else if (relativeX > 0.6) {
        direction = 'r'; // Move right when face is on the left side
      }
      // Vertical position (up/down) - only if horizontal is not active
      else if (relativeY < 0.4) {
        direction = 'u'; // Move up when face is low
      } else if (relativeY > 0.6) {
        direction = 'd'; // Move down when face is high
      }
      
      // Call the callback with the direction if set
      if (direction && onFacePositionChange) {
        onFacePositionChange(direction, { x: relativeX, y: relativeY });
      }
    } catch (err) {
      console.error('Error processing face position:', err);
      setError('Failed to process face position');
    }
  }, [boundingBox, detected, isEnabled, onFacePositionChange]);

  // Function to request camera permission
  const requestCameraPermission = async () => {
    try {
      await navigator.mediaDevices.getUserMedia({ video: true });
      setError(null);
    } catch (err) {
      console.error('Camera permission denied:', err);
      setError('Camera permission denied. Please enable camera access.');
    }
  };

  // Handle errors in detection
  useEffect(() => {
    if (isEnabled && !isLoading && !detected && !error) {
      // No faces detected after loading, but no error yet
      const timer = setTimeout(() => {
        if (!detected) {
          requestCameraPermission();
        }
      }, 5000); // Check after 5 seconds of no detection
      
      return () => clearTimeout(timer);
    }
  }, [isEnabled, isLoading, detected, error]);

  return (
    <div className={`face-detector ${isEnabled ? 'active' : 'inactive'}`}>
      {isEnabled && (
        <div style={{ position: 'relative' }}>
          <Webcam
            ref={faceDetectionWebcamRef}
            className="face-detection-webcam"
            mirrored={true}
            screenshotFormat="image/jpeg"
            style={{
              width: '100%',
              height: 'auto',
              maxWidth: '200px',
              borderRadius: '8px',
              opacity: 0.8,
            }}
            onUserMediaError={(err) => {
              console.error('Webcam error:', err);
              setError('Camera access error: ' + err.message);
            }}
          />
          {/* Face detection status indicator */}
          <div className="detection-status">
            {error ? (
              <div className="status-indicator error" onClick={requestCameraPermission}>
                {error} (Click to retry)
              </div>
            ) : isLoading ? (
              <div className="status-indicator loading">Loading model...</div>
            ) : detected ? (
              <div className="status-indicator detected">
                {facesDetected} face{facesDetected !== 1 ? 's' : ''} detected
              </div>
            ) : (
              <div className="status-indicator not-detected">No faces detected</div>
            )}
          </div>
          {/* Debug visualization of bounding boxes */}
          {!error && boundingBox && boundingBox.length > 0 && (
            <svg
              className="bounding-box-visualization"
              style={{
                position: 'absolute',
                top: 0,
                left: 0,
                width: '100%',
                height: '100%',
              }}
            >
              {boundingBox.map((box, index) => (
                <rect
                  key={index}
                  x={`${(box.xCenter - box.width/2) * 100}%`}
                  y={`${(box.yCenter - box.height/2) * 100}%`}
                  width={`${box.width * 100}%`}
                  height={`${box.height * 100}%`}
                  stroke="#00FFFF"
                  strokeWidth="2"
                  fill="none"
                />
              ))}
            </svg>
          )}
        </div>
      )}
    </div>
  );
};

export default FaceDetector;
